function App() {
  return (

    <header>
      <nav>
        <h2>Gabriel Tomé</h2>
      </nav>

      <ul>
        <li>O que eu faço?</li>
        <li>Projetos</li>
        <li>Quem sou eu?</li>
        <li>Fale comigo</li>
      </ul>

      <div>
      <h1>O que eu faço?</h1>
      </div>

    </header>






  )

}

export default App;
